import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [tasks, setTasks] = useState([]);
  const [error, setError] = useState('');
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [category, setCategory] = useState('');
  const [isEditing, setIsEditing] = useState(false);
  const [currentTaskId, setCurrentTaskId] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    fetchTasks();
  }, []);

  const fetchTasks = async () => {
    try {
      const response = await api.get('/tasks');
      setTasks(response.data);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to fetch tasks');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  const handleAddOrUpdateTask = async () => {
    if (!title || !description || !category) {
      alert('Please fill all fields');
      return;
    }

    try {
      const token = localStorage.getItem('token');
      if (!token) {
        alert('No token provided. Please log in.');
        return;
      }

      if (isEditing) {
        await api.put(`/tasks/${currentTaskId}`, { title, description, category });
        alert('Task updated successfully!');
      } else {
        await api.post('/tasks', { title, description, category });
        alert('Task added successfully!');
      }

      setTitle('');
      setDescription('');
      setCategory('');
      setIsEditing(false);
      fetchTasks();
    } catch (error) {
      alert(error.response?.data?.message || 'Error adding/updating task');
    }
  };

  const handleEdit = (task) => {
    setTitle(task.title);
    setDescription(task.description);
    setCategory(task.category);
    setIsEditing(true);
    setCurrentTaskId(task._id);
  };

  const handleDelete = async (id) => {
    try {
      await api.delete(`/tasks/${id}`);
      alert('Task deleted successfully!');
      fetchTasks();
    } catch (error) {
      alert(error.response?.data?.message || 'Error deleting task');
    }
  };

  return (
    <div className="container">
      <h2>Task Manager</h2>
      {error && <p className="error">{error}</p>}
      <button onClick={handleLogout}>Logout</button>

      {/* Add or Edit Task Form */}
      <h3>{isEditing ? 'Edit Task' : 'Add a New Task'}</h3>
      <input type="text" placeholder="Title" value={title} onChange={(e) => setTitle(e.target.value)} />
      <input type="text" placeholder="Description" value={description} onChange={(e) => setDescription(e.target.value)} />
      <input type="text" placeholder="Category" value={category} onChange={(e) => setCategory(e.target.value)} />
      <button onClick={handleAddOrUpdateTask}>{isEditing ? 'Update Task' : 'Add Task'}</button>

      {/* Task List */}
      <h3>Your Tasks</h3>
      {tasks.length === 0 ? (
        <p>No tasks available. Add some tasks!</p>
      ) : (
        <ul>
          {tasks.map((task) => (
            <li key={task._id}>
              {task.title} - {task.description} - {task.category}
              <button onClick={() => handleEdit(task)}>Edit</button>
              <button onClick={() => handleDelete(task._id)}>Delete</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
